MiApp.Requisito=function(){var a=!0,t=!0,n=!0;return this.eventoOrganismoControl=function(){$("#IdOrganismoControl").on("change",function(o){partialViewListadoTabla()})},this.eventoResponsableGestSeg=function(){$("#IdActorResponsableGestSeg").on("change",function(o){partialViewListadoTabla()})},this.eventoFechaAnno=function(){MiApp.DatePicker.fnCallbackChangeDatepicker=function(){partialViewListadoTabla()}},this.checkUnCheckSemaforo=function(o,e){1==e?$("#semaforo"+o).html("check"):$("#semaforo"+o).html("")},this.eventoSemaforoEstado=function(){$(".semaforo").on("click",function(o){var e=$(o.currentTarget).data("semaforo");switch(e){case 1:a=!a,checkUnCheckSemaforo(e,a);break;case 2:t=!t,checkUnCheckSemaforo(e,t);break;case 3:n=!n,checkUnCheckSemaforo(e,n)}partialViewListadoTabla()})},this.partialViewListadoTabla=function(){MiApp.LoadingPanel.mostrarNotificacion("bodyTemplate","Cargando datos..."),$.ajax({url:urlListadoResult,method:"POST",data:{requisito:{IdOrganismoControl:$("#IdOrganismoControl").val(),IdActorResponsableGestSeg:$("#IdActorResponsableGestSeg").val(),Anno:$("#Anno").val(),SemaforoVerde:a,SemaforoAmarillo:t,SemaforoRojo:n}},success:function(o){$("#divTablaListado").html(o),MiApp.Datatables.inicializarDatatable()},error:function(o){MiApp.Mensajes.mostrarNotificacion("error","Ocurrió un error al cargar los datos, inténtelo nuevamente.")},complete:function(){$("#bodyTemplate").waitMe("hide")}})},{init:function(){eventoOrganismoControl(),eventoResponsableGestSeg(),eventoFechaAnno(),eventoSemaforoEstado()}}}(),MiApp.Requisito.init();